(1, 1, '02313/2018', '04972.005144/2017-72', 1, 'apresentar nos autos o exato posicionamento dos terrenos e acrescidos de marinha nas áreas compreendidas nas transcrições nº 12.480, nº 12.481 e nº 3.386 (evento 1, OUT35, fls. 16-33) e na matrícula nº 13.204 (evento 1, OUT35, fls. 13-15) do Cartório de Registro de Imóveis de Laguna, a fim de facilitar o deslinde do feito', NULL, '2019-01-23', '2019-01-30', '2019-04-23 12:52:45', 9, 3, '2019-01-23 20:13:55', '2019-04-24 16:50:49', 224, 3, 0, NULL, 13),
(2, 1, '01024/2017', '04972.205757/2015-46', 1, 'informar quanto aos desdobramentos das medidas administrativas tendentes à demolição do imóvel em questão, além de realização de diligência no local para esclarecer as dúvidas suscitadas pelo Sr. Oficial de Justiça-Avaliador no Evento 54, a fim de demonstrar de modo inequívoco qual é o bem objeto da demolição', 'Fluxo de contratação de demolição acordado com NUGES/Recursos Internos (Laureano). Ver processo 04972.001973/2019-48.', '2019-02-14', '2018-06-18', '2020-01-07 18:36:05', 9, 3, '2019-02-14 21:38:39', '2020-01-07 18:36:09', 114, 3, 1, NULL, 7),
