(429, 1, '333/2019', '04972.005807/2016-78', 1, '(i) Quais foram as medidas  adotadas  pela  Secretaria  de  Património  daUnião,  no âmbito  de seu poder  de polícia,  a fim  de impedir  as  edificações,em terras  de domínio da União,  localizadas  nos loteamentos  José Loureiro le  II,  no Bairro  Ulysses Guimarães,  em Joinville; e\r\n(ii.)  quais  foram  as  medidas  adotadas  pela  Secretaria  de  Património  daUnião,   no  âmbito   de  seu  poder   de  polícia,   após  ter   sido   constatado,inequivocamente,   a  existência   de  imóveis  interferindo  em  terreno  demarinha   e  acrescidos,  conforme   Ofício   n.   73949/2016-MP  e  Ofício   n°66144/2018-MP (anexos).', 'PENDENTE - COORDENAÇÃO\r\n\r\nO que é:\r\ni) Quais foram as medidas  adotadas  pela  Secretaria  de  Património da União,  no âmbito  de seu poder  de polícia,  a fim  de impedir  as  edificações, em terras  de domínio da União,  localizadas  nos loteamentos  José Loureiro le  II,  no Bairro  Ulysses Guimarães,  em Joinville; e\r\n(ii.)  quais  foram  as  medidas  adotadas  pela  Secretaria  de  Património  da União,   no  âmbito   de  seu  poder   de  polícia,   após  ter   sido   constatado,inequivocamente,   a  existência   de  imóveis  interferindo  em  terreno  demarinha   e  acrescidos,  conforme   Ofício   n.   73949/2016-MP  e  Ofício   n°66144/2018-MP (anexos).\r\n\r\nO que falta:\r\nPrecisamos definir quais diligências adotar junto aos órgãos municipais', '2019-05-24', '2019-04-05', NULL, 1, 3, '2019-05-24 19:27:44', '2020-01-09 14:18:25', 82, 2, 0, NULL, 402),
