(471, 1, '1694/2017', '04972.001913/2019-25', 1, 'prestar informações sobre a regularidade das ocupações na Ilha Araújo de Fora, na Baía da Babitonga, em São Francisco do Sul.\r\nObs: O Ofício da demanda está no processo SEI nº 04972.004280/2016-64', 'PENDENTE - COORDENAÇÃO\r\n\r\nO que é: Relatório de Fiscalização nº 17/2019 - Ilha Araújo de Fora - Baía da Babitonga, RIP 83190100057-50, não existe Ofício pendente nesse processo, porém, o procedimento consta do Ofício 1694/2017.<br>\r\nO que foi feito: Realizada a Fiscalização o ocupante foi Notificado a apresentar documentos que comprovem a regularidade das construções em 30/05/2019.<br>\r\nO que falta fazer: Juntar o Aviso de Recebimento - AR e verificar o atendimento da Notificação. Caso não seja atendida, aplicar as sanções cabíveis.\r\nOfício 37198 (4467873 - ME)  de 11/10/2019, informa ao MPF atendimento  parcial à notificação.\r\nDocumento SEI-ME 4792943 informa e comprova  em 30/10/2019,  que o responsável está providenciando documentos para regularização trapiches', '2018-09-15', '2018-10-15', NULL, 1, 3, '2019-06-03 23:15:31', '2020-01-09 14:30:43', 82, 2, 0, NULL, 436),
(472, 1, '1694/2017', '04972.001914/2019-70', 1, 'informar sobre medidas de fiscalização da ocupação da Ilha Araújo de Dentro, na Baía da Babitonga, em São Francisco do Sul', 'O que é: Relatório de Fiscalização nº 18/2019 - Ilha Araújo de Dentro - Baía da Babitonga, não existe Ofício pendente nesse processo, porém, o procedimento consta do Ofício 1694/2017.<br>\r\nO que foi feito: Realizada a Fiscalização o ocupante foi Notificado a apresentar documentos que comprovem a regularidade das construções em 30/05/2019.<br>\r\nO que falta fazer: Juntar o Aviso de Recebimento - AR e verificar o atendimento da Notificação. Caso não seja atendida, aplicar as sanções cabíveis.\r\nNotificação recebida - Vide AR\r\nVerificar no SPUNet se houve atendimento à Notificação e elaborar resposta mais definitiva ao MPF quanto à impossibilidade de inscrição ex-oficio.', '2017-09-15', '2017-10-16', '2020-01-10 13:45:21', 1, 3, '2019-06-03 23:26:17', '2020-01-10 13:45:23', 82, 3, 0, NULL, 438);
