(473, 1, '1694/2017', '04972.001916/2019-69', 1, 'informar sobre medidas de fiscalização na Ilha dos Negros, localizada na Baía da Babitonga, município de São Francisco do Sul', 'PENDENTE\r\n\r\nO que é: Relatório de Fiscalização nº 20/2019 - Ilha dos Negros - Baía da Babitonga, não existe Ofício pendente nesse processo, porém, o procedimento consta do Ofício 1694/2017.<br>\r\nO que foi feito: Realizada a Fiscalização o ocupante foi Notificado a apresentar documentos que comprovem a regularidade das construções em 30/05/2019.<br>\r\nO que falta fazer: Juntar o Aviso de Recebimento - AR e verificar o atendimento da Notificação. Caso não seja atendida, aplicar as sanções cabíveis.\r\nNot. não recebida -  AR  8841261 /  Renotificar  / Verificar no SPUNet se houve atendimento à Not.e  elaborar resposta mais definitiva ao MPF quanto à impossibilidade de inscrição ex-oficio \r\nPara NUJUC avaliar a pertinência de cancelar esta demanda, uma vez que o procurador responsável pelo inquérito é o procurador Tiago Alzuguir Gutierrez', '2017-09-15', '2017-10-16', NULL, 1, 3, '2019-06-03 23:31:10', '2020-01-13 18:15:53', 82, 2, 0, NULL, 439),
