(668, 1, '1310/2018', '04972.001717/2017-99', 1, 'Referida sentença em favor da União transitou em julgado, conferindo em favor do ente público (União) a reintegração da posse dos imóveis matriculados sob os nºs 19.902 e 19.904 e Transcrição nº 3.210, todas do 4º Registro de Imóveis de Lages (informação quanto aos registros extraída do Ofício nº 15/2014-PUSC:EDIT, de 07/01/2014 – em anexo). Conforme  referido  na  sentença  transitada  em  julgado,  não  foi  expedido  o mandado de reintegração em razão das tratativas de acordo no âmbito administrativo. Sobre as tratativas entre os órgãos e entes envolvidos (SPU/SC, Município de Lages, DNIT), verifico que: - no tocantes às áreas 1 e 3, houve manifestação de interesse por parte do DNIT, nos termos do Ofício 566/2016/DIF/DNIT, de 24/11/2016 (Evento 2 – PROCJUD11, página  3  –  em  anexo),  restando,  assim,  contraditória  a  informação  constante  da  Nota Informativa nº 5409/2018-MP, de 24/05/2018; - no tocante às áreas 2 e 4, existia a intenção de regularização fundiária de interesse social  mediante a sua doação por parte da União ao Município de Lages, conforme se lê na Nota Técnica 13592/2017-MP (Evento 2 – PROCJUD11, páginas 5/6 – em anexo). Assim, tendo em vista os documentos oriundos deste r. órgão e do DNIT acima mencionados: a)renovo a solicitação de informação quanto ao deslinde administrativo da questão junto ao DNIT relativamente às áreas 1 e 3; b)solicito seja informado se as áreas 2 e 4, objeto da ocupação irregular pelos réus  particulares,  foram  efetivamente  cedidas  ao  Município  de  Lages  e  procedida  à regularização fundiária, ou se, ao contrário, remanesce interesse na expedição de mandado de reintegração de posse, visando à sua desocupação.', NULL, '2018-06-20', NULL, '2020-01-15 15:37:18', 1, 3, '2019-06-26 21:37:44', '2020-01-15 15:37:24', 224, 3, 0, NULL, 646),
(669, 1, '00147/2018', '04972.001028/2009-74', 1, 'entendeu-se não ser oportuna a designação de audiência de conciliação, sendo cabível dar seguimento às tratativas de doação da área ao Município para que este ente promova a regularização da cua ocupação.', NULL, '2018-08-28', NULL, '2020-01-15 15:31:02', 1, 3, '2019-06-26 22:01:57', '2020-01-15 15:31:07', 264, 3, 0, NULL, 648),
