(701, 1, '133/2019', '10154.105019/2019-60', 0, 'análise dos documentos que acompanham o Parecer de Força Executória.', 'Resposta da consulta à CJU-SC (OFÍCIO SEI Nº 46/2019/NUJUC/SPU-SC/SPU/SEDDM-ME):\r\nEm resumo, fomos orientados a somente iniciar a cobrança do valor atualizado da taxa de ocupação após a decisão final do processo administrativo instaurado com tal finalidade, ou seja, somente depois de atendidos \"todos os requisitos legais exigidos em diversas decisões judiciais idênticas, quais sejam: intimar pessoalmente a parte; conceder prazo para defesa e apresentação de documentos; intimar da decisão administrativa que alterar o valor; abrir prazo para o recurso; apreciar eventual recurso e somente após a publicação ou intimação do resultado desse recurso, ou seja, da decisão final, iniciar a cobrança do novo valor da taxa de ocupação\".\r\n\r\nDessa forma, o marco temporal que encerra a cobrança dos valores com a simples atualização pelo IPCA-E e inicia a cobrança dos novos valores definidos em novo procedimento de atualização é do da conclusão do processo administrativo instaurado com essa finalidade, devendo ser observados os prazos para apresentação de recurso pelo administrado, constantes em cada notificação ou na legislação vigente.\r\n\r\nO que falta fazer:\r\n- NUCIP definir valores e datas\r\n- NUREP operacionalizar a cobrança\r\n- Informar à AGU', '2019-06-27', '2019-07-26', '2020-01-07 17:51:44', 4, 3, '2019-07-04 22:36:36', '2020-01-07 17:51:47', 224, 3, 0, NULL, 672),
