(713, 1, '6111/2016', '04972.000133/2017-04', 0, 'que em relação ao documento em que Annito Zeno Petry e Habitasul cedem terras ao Município, informação detalhada quanto ao encaminhamento, no âmbito do Serviço do Património da União, que foi dado a tal cessão, desde 31/7/1990 até hoje; informação trazendo a relação dos fatos que estejam registrados e que liguem os documentos com a sua localização atualizada, e seja informado se o Serviço do Património da União tem registrado o conceito de postos de praia.', 'undefined', '2016-12-19', '2017-01-13', '2020-01-20 18:15:20', 17, 4, '2019-07-05 21:46:36', '2020-01-20 18:15:24', 91, 3, 0, NULL, 687),
(714, 1, '1964/2016', '04972.006336/2016-15', 0, 'o encaminhamento e  informações/documentos sobre a área localizada na \"Rua dos Pescadores\", lateral da Estrada Geral do Frias, Bairro Frias, Município e ao Francisco do Sul,  se pertence à União, notadamente se abrange terras de marinha e seus acrescidos.', 'O que é:\r\nsolicita o encaminhamento e  informações/documentos sobre a área localizada na \"Rua dos Pescadores\", lateral da Estrada Geral do Frias, Bairro Frias, Município e ao Francisco do Sul,  se pertence à União, notadamente se abrange terras de marinha e seus acrescidos.\r\n\r\nO que foi feito:\r\nfoi encaminhado ao MPF o Relatório de Fiscalização Individual nº 35/2019\r\n\r\nO que falta:\r\no processo foi encaminhado à DIREP para (a) emissão do DARF no valor total especificado no auto de Infração  ( 8693855 );    (b) notificar o infrator sobre os débitos consolidados para quitação, mediante envio do DARF e, caso não sejam regularizados os débitos, formalizar/instruir o processo para inscrição no CADIN e em DAU;   (c) para gerenciamento das cobranças  pela área de receitas nos termos do normativo SPU descrito pelo Memorando nº 8922/2017-MP (4230575), constante do processo 04905.002069/2017-91, o que inclui a emissão de DARF mensalmente, considerando-se o art. 6º, do DL 2.398/87:   \" §A multa de que trata o inciso II do § 4º  será mensal, sendo automaticamente aplicada pela Superintendência do Patrimônio da União sempre que o cometimento da infração persistir\".\r\nProcesso aberto na  SPU-SC-NUREP / AUTOS DE INFRAÇÃO para andamento. Considera-se', '2016-11-24', '2016-12-24', '2020-01-07 17:40:55', 17, 3, '2019-07-05 21:55:51', '2020-01-07 17:40:58', 82, 3, 0, NULL, 688),
(715, 1, '364/2019', '10154.105245/2019-41', 0, 'Informar se os imóveis de propriedade de Denise Neves da Silva Machado, construídos entre as localidades conhecidas como \"Arroio Corrente\" e \nCampo Bom\", no município de Jaguaruna (coordenadas geográficas: Imóvel 1 - 28°42\"28.13\"S 49°02\"24.57\"W; Imóvel 2 - 28°42\"27.79\"S 49°02\"24.81\"W), estão situados total ou parcialmente em terrenos de marinha e/ou acrescidos. Jaguaruna/SC.', 'Distribuído - Em análise.', '2019-06-17', '2019-07-15', '2019-07-18 20:42:56', 8, 4, '2019-07-08 15:10:46', '2019-07-19 20:17:40', 65, 3, 0, NULL, 689),
