(739, 1, '65/2018', '04972.002868/2018-45', 0, 'Desocupação do bem público (trapiche), tendo em vista que a Mitra Metropolitana e a Associação dos Moradores da Costa\r\nLagoa, não possuem direito a cessão de uso (cópia em anexo) de bem público, e tampouco o de deliberar construção de estrutura de deck sobre as águas da Lagoa,que somente seria autorizado mediante a apresentação de EIA/RIMA (Cláusula 3a do TAJ) para o seu regular funcionamento.', 'Inquérito arquivado.', '2018-01-12', '2018-02-03', '2020-01-27 19:27:23', 18, 4, '2019-07-10 17:42:17', '2020-01-27 19:27:25', 91, 3, 0, NULL, 518),
