(865, 1, '1213/2019', '04972.000320/2019-41', 0, 'manifestação no sentido de informar a situação do local e as medidas eventualmente necessárias a demolição. Balneário Camboriú', 'O que é:\r\nConsiderando a inércia do executado em promover a demolição, o magistrado proferiu o Despacho/Decisão no evento 108 dos autos da ação de execução nº 5011583-90.2016.4.04.7208, datado de 10/01/2019, intimando a União para, através da Superintendência do Patrimônio, proceder à demolição da edificação em questão, devendo contatar diretamente o IMA – Instituto do Meio Ambiente de Santa Catarina para acompanhar o processo de remoção do material, consoante constou no acórdão, no prazo de 60 dias.\r\n\r\nO que foi feito:\r\n1) demanda encaminhada ao Núcleo de Fiscalização (Despacho 3397471)\r\n2) Ofício nº 54320/2019/DIGES-SPU-SC/MP encaminhado à Prefeitura de BC, solicitando auxílio da demolição da obra\r\n3) Ofício nº 54483/2019/DIGES-SPU-SC/MP encaminhado à AGU, informando das medidas adotadas (fiscalização p/ 08/08/19 e ofício à PMBC)\r\n4) vistoria no local verificou que a demolição não foi efetivada\r\n5) processo foi encaminhado ao NUGES para contratação do serviço de demolição\r\n\r\nO que falta fazer:\r\n\r\n1) contratação do serviço de demolição, nos moldes estabelecidos no Despacho COSUL-SPU (8320910) constante do NUP 04972.001973/2019-48, devendo a AGU ser informada do tempo necessário para a contratação do serviço.', '2019-07-29', '2019-08-05', '2019-09-19 23:01:35', 3, 23, '2019-07-30 22:20:39', '2019-09-19 23:02:28', 126, 3, 1, NULL, 48),
(866, 1, '28/2019', '04972.001325/2019-91', 0, 'Aguarde a realização de estudo antropológico e o seu encaminhamento para a finalização do Processo nº 04972.009998/2018-17', 'undefined', '2019-07-24', NULL, '2019-10-11 16:20:05', 4, 23, '2019-07-31 19:33:56', '2019-10-11 16:20:07', 234, 3, 0, NULL, 88),
(867, 1, '1202/2019', '04972.003534/2019-70', 0, 'Informe se a decisão foi cumprida.( Demolição).', 'Foi feita a fiscalização na qual foi constatado o seguinte:\r\nA partir da ação de fiscalização do imóvel na Praia do Campeche,  contactamos  o Sr Edi Luis de Oliveira responsável pelo mesmo alvo da sentença judicial, que nos acompanhou na vistoria e relatou estar executando o cumprimento da sentença de demolição das benfeitorias,  que já se encontram parcialmente demolidas com cerca de trinta por cento já executadas,  Porém alegou que por questões pessoais não teve condições de  concluir a demolição conforme sentença. O  responsável se comprometeu  que até a data de 05/10/2019 estarão finalizadas as obras de demolição. Procedemos então com a coleta de dados conforme Relatório Fotográfico nº 8845797 e mapa de locação anexo nº8695212. \r\nAguardar nova fiscalização para comprovar a demolição.', '2019-07-25', '2019-09-27', '2019-08-07 19:53:10', 4, 1, '2019-07-31 20:06:50', '2019-10-07 17:18:21', 126, 3, 1, NULL, 377),
