(1177, 1, '193/2019', '04972.004141/2017-11', 0, 'encaminha o laudo técnico produzido pela ré IMOBILIÁRIA ZATTAR LTDA, visando auxiliar a SPU/SC no cumprimento da sentença judicial que determinou que determinou a regularização do loteamento, cujo prazo de 180 (cento e oitenta) está em curso, sob pena de multa', 'PENDENTE - COORDENAÇÃO\r\n\r\nMulta: R$ 200,00/dia\r\n\r\nTERMO DE AUDIÊNCIA:\r\n(...) No que toca ao prosseguimento da presente execução, fixo o prazo de 180 (cento e oitenta) dias para que a União promova a regularização dos lotes localizados em sua área de terreno de marinha abarcado pelo título, inclusive com o respeito da regulamentação legal a respeito dos requisitos de regularização. Defiro, ainda, em parte, os pedidos de fixação de multa em desfavor da União e do chefe da SPU. Quanto a este, fica fixada a multa de R$ 200,00 por dia de atraso, a ser contado quando escoado o prazo de 180 (cento e oitenta) dias, do que deverá ser pessoalmente intimado, sem prejuízo de ele - a autoridade -, demonstrar nos presentes autos a existência de fato de terceiro a fim de o eximir da sanção. Quanto à União, fixo a multa em R$ 1.000,00/dia de atraso, contados também do mesmo termo inicial. Ficam autorizados a Imobiliária Zattar Ltda. e o Município de Joinville a participar voluntariamente do procedimento de regularização, o que não servirá como justificativa para que a SPU desrespeite o prazo de \r\ncumprimento.', '2019-10-02', '2020-03-10', NULL, 4, 3, '2019-10-08 16:36:37', '2020-01-08 16:33:58', 99, 2, 1, NULL, 981),
