(1318, 1, '831/2019', '10154.130220/2019-85', 0, 'informe se, quando da inscrição desses imóveis, foi observada a possível interferência do empreendimento na vegetação de restinga e na praia, especialmente em função do sombreamento que essas construções podem causar, nos termos do que dispõe o artigo 9º, inciso II da Lei 9.636/98; bem como esclareça se há algum parecer/orientação da AGU para a inscrição de ocupação de imóveis localizados na orla da praia e que possam vir a causar sombreamento', 'undefined', '2019-11-05', '2019-11-20', '2019-11-12 22:19:51', 4, 3, '2019-11-06 21:21:18', '2020-01-08 12:12:07', 74, 3, 0, NULL, 1034),
(1319, 6, '022', '04972.008876/2018-03', 0, 'apertadíssimo resumo, a remoção de aterro, estruturas físicas e vegetação exótica em área localizada em frente à propriedade da pessoa física demandada, entre a margem da Lagoa do Capri e a Rua Blandina Steiner Beckhauser, no Balneário de Capri, em São Francisco do Sul, bem como a recuperação ambiental da referida área e a condenação dos réus no pagamento de indenização pelos danos causados ao meio ambiente, além da decretação de nulidade de todas as licenças, alvarás e inscrição de ocupação, eventualmente expedidos pelo Município de São Francisco do Sul, FATMA e União.', 'Cumprir de forma coordenada, com os demais réus os termos finais da ação.', '2019-09-14', NULL, '2019-11-11 21:09:03', 8, 23, '2019-11-06 21:22:27', '2019-11-27 22:18:03', 201, 3, 1, NULL, 1204),
(1320, 1, '0399', '04972.014104/2012-15', 0, 'informando-nos sobre o trânsito em julgado da ação, pedido improcedente.\nem síntese, foi postulado: (i) declaração de nulidade do alvará nº 860, expedido pelo Município de Itajaí, e do Estudo de Impacto de Vizinhança elaborado pelo edifício \"Mirage Residence\"; (ii) condenação do Município de Itajaí e [d]os empreendedores por danos causados, revertendo-se o valor da indenização ao Fundo dos Direitos Difusos (artigo 13, LACP); (iii) condenação dos réus a demolirem o empreendimento e a recuperarem toda a área afetada; (v) condenação dos demandados a promoverem, em jornal de circulação regional, a publicação da sentença.\nA União figurou apenas como interessada na presente ação.', NULL, '2019-10-11', NULL, '2019-11-07 15:08:59', 8, 8, '2019-11-07 15:08:34', '2019-11-07 15:09:01', 106, 3, 0, NULL, 406),
