(1477, 8, '5024718-88.2019.4.04.7201', '10154.153402/2019-24', 0, 'Trata-se de mandado de segurança impetrado por CMO Construção e Montagem Offshore S.A. em face do Superintendente da Secretaria de Patrimônio da União em Santa Catarina visando a que se determine à autoridade impetrada que promova o cálculo de valor para cobrança de cessão de espaço aquático de acordo com o art. 11-B da Lei nº 9.636/1998 e do § 4º do art. 33 da IN 05/2018, considerando a Pauta de Valores da Terra Nua 2019 do INCRA para São Francisco do Sul e a aplicação da equação prevista no art. 33 da IN 05/2018.\r\n\r\nO pedido de liminar foi indeferido e a autoridade impetrada (Superintendente) foi notificada, Ofício de Notificação (5548731), para que preste informações no prazo de 10 (dez) dias.\r\n\r\nO pedido de Liminar está relacionado com as decisões proferidas no processo SEI-ME nº 04972.205753/2015-68.', 'undefined', '2019-12-12', NULL, '2019-12-17 12:06:45', 3, 3, '2019-12-13 16:49:38', '2019-12-17 12:06:47', 363, 3, 0, NULL, 1322),
