(1490, 1, '1691/2019', '04972.002646/2004-27', 0, 'Trata o presente do OFÍCIO n. 01961/2019/PROT/PUSC/PGU/AGU, datado de 25/11/2019, inicialmente encaminhado à Procuradoria-Geral Adjunta de Consultoria e Estratégia da Representação Judicial e Administrativa Tributária e redirecionado a esta SPU-SC, em 17/12/2019, conforme Anexo e-mail da AGU (5601024).\r\n\r\nO referido ofício solicita que sejam adotadas as  medidas necessárias junto a Pasta da Economia para efetuar o depósito à disposição do juízo da 3ª Vara Federal da Subseção Judiciária de Itajaí, do montante de R$ 952,00 (novecentos e cinquenta e dois) reais, a título pagamento do tradutor, nos termos da proposta do Evento 251, em cumprimento aos r. despachos dos Eventos 210, 257 e 262.\r\n\r\nSalienta, ainda, que nada obstante o recurso de lei, na r. decisão do Evento 262, foi fixada multa de R$ 500,00 (quinhentos reais) por dia em caso de descumprimento e foi estabelecido o prazo de cinco dias para tanto.\r\n\r\nEm vista disso, proponho pelo encaminhamento à unidade SEI-ME SPU-SC-NUGES, para que seja encaminhado expediente à Unidade Central da SPU, solicitando, com máxima urgência, a descentralização dos recurso para realização do pagamento.', 'undefined', '2019-12-25', '2019-12-27', '2019-12-30 19:32:42', 3, 3, '2019-12-18 19:53:08', '2020-01-02 20:29:17', 114, 3, 0, NULL, 1334),
