(1243, 6, 1, '0334/2019-4', 'Identificação de Área', 'Visando instruir os autos do Inquérito Policial n° 0334/2019-4 - SR/PF/SC,\r\nsolicito ao Senhor informar se a área no ponto de coordenadas UTM (zona 22 1 SIRGAS 2000):\r\n743166 E 6947870 N que está servindo de estacionamento, localizado na Ponta do Coral,\r\nFlorianópolis/SC incide em terrenos de marinha e seus acrescidos, e se há autorização de\r\nconservação e uso. Se houver qualquer autorização, enviar cópia da(s) mesma (s).', 'undefined', '2019-11-21 14:45:20', '2019-11-21 14:45:20'),
(1244, 4, 1, '1.33.000.002137/2019-11', 'ATERRO. ÁREA DE PRESERVAÇÃO PERMANENTE. MANGUE. ÁREA DE MARINHA. PALHOÇA/SC.', 'O Ministério Público Federal, nos termos do artigo 129, inciso III, da\r\nConstituição Federal, e do artigo 50, inciso III, alínea \"d\", da Lei Complementar n° 75/93;\r\nvisando instruir o expediente em epígrafe, vem requisitar, no prazo de 30 (trinta) dias,\r\ninformações sobre a titularidade e a regularidade da propriedade degradada, situada na Rua\r\nPrefeito Otávio Zacchi n. 333 (findos), Centro, Município de Palhoça/SC, informando\r\ntambém sobre licença/autorização de terreno pertencente à Sevasti Drôse Rod. e/ou em\r\nnome de Marcelo de Souza, que, este supostamente, em área de 100m2 de manguezal, em\r\nterreno de marinha, edificou no local uma casa de 74m2.', 'undefined', '2019-11-21 14:50:13', '2019-11-21 14:50:13'),
(1245, 1, 1, '1.33.000.000607/2019-1', 'GALPÃO DE RECICLAGEM - INGLESES - CONSTRUÇÃO IRREGULAR - ÁREA DE MARINHA - BENS DA UNIÃO.', 'O Ministério Público Federal, nos termos do artigo 129, inciso III, da Constituição Federal,\r\ne do artigo 5°, inciso 111, alínea \"d\", da Lei Complementar n° 75/93; visando instruir o\r\nexpediente em epígrafe, vem requisitar, no prazo de 30 (trinta) dias, para que traga\r\ninformações sobre possível degradação ambiental provocada por um Galpão de\r\nReciclagem, na altura do número 1600, na Rua Graciliano Manoel Gomes, esquina com a\r\nServidão Gerivá, no Bairro dos Ingleses, informando se o local se situa em área de marinha\r\nou em seus acrescidos, se incide sobre Unidade de Conservação Federal ou seu entorno, e se\r\nafeta interesse de bens ou entidades federais, caso a construção afete a área de marinha ou\r\nbens da União, informe se encontra-se regular perante à SPU e, caso negativo, quais as\r\nmedidas devem ser adotadas.', 'undefined', '2019-11-21 14:54:35', '2019-11-21 14:54:35'),
