(1307, 3, 4, '5029866-83.2019.4.04.7200', 'SANEAMENTO', 'Informo que David Soares Noronha Mendonça ingressou com a Ação popular nº\r\n5029866-83.2019.4.04.7200, em face da União, Prefeitura Municipal de Florianópolis e Outros,\r\nem trâmite na Sexta Vara Federal da Subseção Judiciária de Florianópolis, tendo por objeto, o lixão do\r\nItacorubi.\r\nA ação visa à condenação da COMCAP e da ACMR em obrigações de fazer consistes na\r\ndesocupação da área em que operam as atividades causadoras de danos ambientais, localizado no\r\nbairro Itacorubi devido ao reiterado descumprimento das condicionantes ambientais expressas em suas\r\nlicenças de operação e a legislação ambiental e urbanística pertinente, bem como a recuperação\r\nambiental e destinação do imóvel compatível com o zoneamento urbano e com a resiliência ambiental;\r\nEm face da União a ação pretende o cancelamento da cessão de uso do imóvel ou a sua\r\nnão renovação em 2023 (previsão de término), destinando o terreno para atividades que promovam a\r\neducação ambiental e a valorização daquele ecossistema; incluí-la solidariamente na recuperação\r\nambiental e destinação adequada do imóvel.\r\nO Autor busca, ainda, a condenação da Prefeitura Municipal de Florianópolis e do IMA SC em\r\nobrigação de fazer, solidariamente com os réus prestadores de serviços públicos municipais,\r\nconsistentes na desocupação do referido terreno, recuperação da área e destinação adequada por não\r\ndesempenhar o controle finalístico das atividades e por não garantir o cumprimento das condicionantes\r\nambientais, respectivamente.', '958711020819', '2019-12-06 19:25:13', '2019-12-06 19:25:13'),
