(1325, 1, 1, '1.33.008.000266/2015-71', 'Ao tempo em que o cumprimento cordialmente, venho por meio deste, visando à instrução do inquérito civil em epígrafe e com fundamento no Artigo 8°, in', 'Ao tempo em que o cumprimento cordialmente, venho por meio deste,\r\nvisando à instrução do inquérito civil em epígrafe e com fundamento no Artigo 8°, inciso II,\r\nda Lei Complementar n° 75/93, solicitar que seja encaminhadas informações atualizadas\r\nreferentes a Certidão de Inscrição de Ocupação n° 1024, referente ao RIP n°\r\n8265.00957.000-5 e processo n° 10983.004955/93-73.', 'undefined', '2019-12-13 21:57:48', '2019-12-13 21:57:48'),
(1326, 2, 4, '5002791-21.2019.4.04.7216', 'Demolição, remoção e PRAD', 'Ação Civil Pública por meio da qual o MPF postula a demolição integral de edificação(ões), a remoção e adequada destinação final de todo o material decorrente da demolição e a recuperação integral do meio ambiente através da elaboração e implementação de Projeto de Recuperação de Área Degradada – PRAD. Requer, ainda, o pagamento de indenização pelos danos ambientais intercorrentes, além da anulação da inscrição de ocupação de terreno/acrescido de marinha e do patrocínio em jornal de divulgação regional da publicação da sentença.', '203210774619', '2019-12-16 15:27:39', '2019-12-16 15:27:39'),
(1328, 3, 1, '5021502-59.2018.4.04.7200', 'DESAPROPRIAÇÃO POR UTILIDADE PÚBLICA / DL 3.365/1941', 'Litoral Sul S.A., com o objetivo de obter a desapropriação e a imissão na posse de área localizada\r\nem Palhoça/SC, a fim de realizar as obras de implantação do Contorno de Florianópolis/SC.\r\n2. A parte Autopista Litoral Sul S/A apresentou proposta de acordo para pagamento da desapropriação\r\nno valor de R$ 84.105,94, conforme valor obtido do laudo constante no processo nº 5021849-92.2018.4.04.7200:\r\nÁREA TOTAL DESAPROPRIADA: 543,32 m², ÁREA LOCALIZADA na Rua do Morro do Cipó, s/nº - Bairro: São\r\nSebastião, Palhoça/SC - CEP: 88136-230, OBJETO DO MEMORIAL DESCRITIVO, PLANTAS 81A, ANEXADOS\r\nNO EVENTO 4.\r\n3. A proposta foi aceita pelos expropriados.\r\n4. Seguem cópias das matrículas do imóvel registrado em nome da União.', '870525617918', '2019-12-16 17:46:45', '2019-12-16 17:46:45'),
