(1342, 2, 4, '5002789-51.2019.4.04.7216', 'Praia da Ilhota/Ypuã', 'Casa(s) de veraneio na Praia do Ypuã, em Laguna/SC, está(ão) situada(s) em área de preservação permanente - APP (dunas com vegetação de restinga), área de preservação ambiental - APA da Baleia Franca e terreno ou acrescido de marinha, tendo sido erigida(s) sem autorização do órgão ambiental competente. Assevera que o Município de Laguna e a União foram omissos e ineficientes no exercício do poder de polícia administrativo ambiental.', '854377366519', '2019-12-19 20:02:41', '2019-12-19 20:02:41'),
(1343, 2, 1, '1.33.007.000211/2018-13', 'Identificação de imóvel', 'Visando à instrução do procedimento em epígrafe, solicito-lhe que informe se\r\no imóvel de propriedade de Michelle Castro de Azevedo, CPF n. 978.907.740-87,\r\nlocalizado no Farol de Santa Marta, município de Laguna, coordenadas geográficas de\r\n22J713321 m E 6834036 m S, apontadas pela FLAMA por meio do Parecer Fiscal n.\r\n041/2019, cópia em anexo, está inserido em terrenos de marinha e/ou acrescidos, e em caso\r\npositivo, se possui inscrição de ocupação.', 'undefined', '2020-01-02 13:41:48', '2020-01-02 13:41:48'),
(1345, 4, 1, '1.33.009.000172/2019-15', 'Cumprimentando-o cordialmente, faço menção ao procedimento em epígrafe para encaminhar cópia da representação que deu origem ao feito, solicitando, co', 'Cumprimentando-o cordialmente, faço menção ao procedimento em epígrafe\r\npara encaminhar cópia da representação que deu origem ao feito, solicitando, com\r\nfundamento no art. 8°, II, da Lei Complementar ir. 75/1993, que no prazo de 10 (dez)\r\ndias úteis encaminhe informações acerca do instrumento de cessão de uso de bem da\r\nUnião ao aeroclube de Joaçaba, informando se há convênio vigente, e, ainda, se há\r\nirregularidade na construção, funcionamento e venda dos hangares, consoante o informado\r\nao MPF.', 'undefined', '2020-01-02 14:19:02', '2020-01-02 14:19:02'),
(1346, 8, 1, '1.33.000.001870/2014-11', 'Imóvel da União Cedido', 'Trata o presente do OFICIO n° 4760/2019- GAB-WAM - PA n° 1.33.000.001870/2014-11, que informa e solicita o seguinte:\r\n\r\n\"em vista do acordado na reunião realizada em 27/11/2019 na Procuradoria da República em Florianópolis/SC, vem requisitar no prazo de 30 dias as seguintes informações acerca do terreno/prédio no qual foi erigido o CECA - Centro de Educação Ambiental e Entretenimento, localizado na Rodovia SC 401, km 11, n° 3116 - Saco Grande, Florianópolis - SC, 88032-005 (Shopping Floripa), onde foi recentemente inaugurado o Museu do Mar pelo Instituto NOAH:\r\na) se haveria a possibilidade da SPU/SC reverter a cessão da área do CECA ao IBAMA/ICMBio, que ocorreu no bojo do acordo judicial firmado nos autos da ACP 96.00.06712-0;\r\nb) se haveria possibilidade de fazer a cessão da área ao Instituto NOAH, Organização Civil sem fins lucrativos qualificada como OSCIP (CNPJ 09.626.134/0001-97), caso revertida a cessão ao ICMBio;\r\nc) se a área do CECA porventura faz parte do RIP pertencente ao Shopping Floripa\".', 'undefined', '2020-01-02 14:36:46', '2020-01-02 14:36:46'),
