(1372, 3, 1, '5003327-41.2019.4.04.7213', 'USUCAPIÃO ORDINÁRIA - Rio do Sul.', '1.Sirvo-me do presente para informar sobre a ação de usucapião de imóvel de matrícula 39926, de Rio\r\ndo Sul.\r\n2. A União foi intimada em razão de ser confrontante aos fundos do imóvel usucapiendo - Evento 1.\r\nINIC1 fl. 26.\r\n3. Sendo assim, solicito a essa SPU/SC que verifique eventual interferência com imóvel da União\r\n- prazo de 10 dias.', '443782094719', '2020-01-14 19:56:33', '2020-01-14 19:56:33'),
(1373, 3, 1, '0001400-29.2012.8.24.0020 e 020.12.001400-9', 'Usucapião', 'Evaldo Pizzetti e outros ajuizaram a Ação de Usucapião n. 020.12.001400-9, objetivando a\r\ndeclaração de propriedade sobre imóvel localizado em Criciúma.\r\nAo analisar possível interferência com áreas de domínio público federal, essa\r\nSuperintendência informou que \"o imóvel usucapiendo não interfere com terras de marinha, acrescidos,\r\nrios e rodovias federais, nem está em zona de segurança nacional\".\r\nPor outro lado, a Inventariança da Extinta RFFSA afirmou o seguinte:\r\n1 - Com os dados constantes no processo, conforme planta e demais indicações de situação\r\nda área requerida, nós localizamos e verificamos no mapa que onde está atualmente a Rua\r\nBernardo Topanotti Pizzetti, que continua com a Rua Augusta Pizzetti de Oliveira, foi a Faixa\r\nde Domínio do extinto Ramal Ferroviário da Mina do Mato.\r\n2 - Com esta condição verificada, é preciso que se faça referência à situação, e também\r\nque se deixe consignado em planta qual a distância ao antigo eixo do traçado da linha.\r\n3 - Verificamos e localizamos no mapa, que a área em questão, confrontava com a antiga\r\nfaixa de domínio aproximadamente entre km 3+730 ao km 3+825 e, cuja faixa de domínio\r\nera de 40 metros, sendo 20 metros para cada lado a partir do eixo da linha. (Mapa anexo)\r\n4 - Assim sendo, estamos contestando a planta e a dimensão da área requerida pois até\r\nprova em contrário, está interferindo com próprios da extinta RFFSA.\r\nDesse modo, solicito que essa Superintendência confirme ou retifique a informação de que\r\no imóvel usucapiendo interfere parcialmente com bem da União (faixa de domínio de extinta linha\r\nférrea). Caso a informação seja confirmada, solicito que: (a) seja apontada em mapa a exata porção do\r\nimóvel usucapiendo que interfere com bem da União; (b) sejam encaminhados os documentos\r\ncomprobatórios da propriedade da União sobre a área.', 'undefined', '2020-01-15 19:28:10', '2020-01-15 19:28:10'),
