(1499, 6, 1, '2020.0003130', 'Terreno de marinha', 'Informar se o imóvel objeto da autuação realizada pela Polícia Militar Ambiental - PMA/PMSC, conforme Termo Circunstanciado lavrado em 28/09/2019, encontra-se inserido em área de marinha e seus acrescidos.', 'undefined', '2020-03-04 16:54:03', '2020-03-04 16:54:03'),
