(1501, 2, 1, '5002712-53.2020.4.04.7201', 'Área de Preservação Permanente', 'Ajuizamento pelo MPF da ação civil pública em epígrafe, em que alega a degradação ao meio ambiente decorrente de acessão física construção (casa, muro e trapiche) em área de preservação permanente e de praia indevidamente ocupada, na Estrada Geral do Estaleiro, bairro Vila da Glória, s/n, São Francisco do Sul, SC (UTM 22J 730218/7095132).', '804904217020', '2020-03-04 18:03:37', '2020-03-04 18:03:37'),
(1503, 2, 1, '5002720-30.2020.4.04.7201', 'Cessão de espaço aquático', 'Identificar a área em questão como mar territorial, ou não. Em se tratando de área fora do mar territorial, fica a SPU instada a cancelar a cessão de uso do espaço aquático e a restituir os montantes já cobrados.', '154920066320', '2020-03-04 18:57:40', '2020-03-04 18:57:40'),
(1505, 3, 2, '5000251-51.2010.4.04.7204', 'Taxa de ocupação', 'Parecer de Força Executória: nos termos do decidido, não é possível a cobrança da majoração da taxa de ocupação, tendo em vista a ausência de intimação pessoal da parte interessada.', 'undefined', '2020-03-05 17:15:18', '2020-03-05 17:15:18'),
(1506, 3, 2, '5001071-11.2012.4.04.7201', 'ANULAÇÃO DE DÉBITO FISCAL', 'Parecer de Força Executória: o decreto de nulidade do procedimento administrativo proferido nos autos ajuizados por José Felipe Carbonell e sua esposa merece ser observado também para o período pretérito àquela ocupação e possui efeitos prospectivos até que a Secretaria do Patrimônio da União proceda à nova demarcação da LPM no local.', 'undefined', '2020-03-05 17:29:38', '2020-03-05 17:29:38'),
